import React from "react";


const Home = ({ posts }) => {
  return (
    <main className="Home">
      {posts.length ? (
        <Feed posts={posts} />
      ) : (
        <p style={{ margintop: "2rem" }}>No Posts To Display</p>
      )}
    </main>
  );
};

export default Home;
